// Home/page.js
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h1>Strona Główna</h1>
      <nav>
        <ul>
          <li><Link to="/lab7">Lab 7</Link></li>
          <li><Link to="/lab8">Lab 8</Link></li>
        </ul>
      </nav>
    </div>
  );
}

export default Home;
